"1. When the stock price is higher than the average line, the trend is stronger; when the stock price is lower than the average line, the trend is weaker; 
2. When two or more average lines cross upwards (Golden Cross), buy reference; 
3. When two or more average lines cross downwards (die cross), sell for reference; 
4. Long-term moving average arrangement: When multiple moving averages diverge upward, the long-term trend is upward; when multiple moving averages diverge downward, the long-term trend is downward. Long hair loose is an important holding period, short hair loose is an important short position period."
